import './Botao_esp.css';
import React, { Component, useState } from 'react';


export default function Botao_esp(props) {
  const { titulo, dificuldade, conclusao, tempo } = props;

  return (
    <div className="casa_pergunta">
      <div className="front">
        {titulo}
      </div>
      <div className="back">
        <p>{conclusao}</p>
        <p>{dificuldade}</p>
        <p>{props.children}</p>
        <p>{tempo}</p>
      </div>
    </div>
  );
}
